import {combineReducers} from 'redux';
import tasks from '../reducers/tasks';
import ui from '../reducers/ui';
import modal from '../reducers/modalGlobal';

const rootReducer = combineReducers({
    tasks,
    ui,
    modal
})
export default rootReducer;
